ISLAMABAD, Nov 09 (APP): The Senate session commenced at 03:34 p.m. here on Sunday under the chairmanship of Chairman Senate Syed Yousaf Raza Gilani.

The House was set to take up a motion regarding the Constitution (Twenty-seventh Amendment) Bill, 2025.

